INSERT INTO `plugin_translation` VALUES (_binary '.	¿\'B{¾Pk\×\İC\ÖZ',_binary '/»_\â\âšMpªXT\Î|\ã\â','PayPal Products for Shopware 6','Get access to over 100 currencies and 200 markets worldwide with the payment module PayPal for your Shopware shop. Experience an easy and comfortable way of payment.','https://store.shopware.com/en/shopware-ag.html','https://issues.shopware.com/','{\"0.9.0\": [\"First version of the PayPal integrations for Shopware 6\"], \"1.0.0\": [\"PT-11181, PT-11275 - Add PayPal PLUS integration\", \"PT-11277 - The cart and order number submitting is now active by default\"], \"1.1.0\": [\"PT-11276 - Add banner for advertising installments\"], \"1.1.1\": [\"PT-11443 - Solves an issue with the error handling with the paypal credentials\", \"PT-11475 - Improved processing of vouchers during checkout\"], \"1.2.0\": [\"PT-11233 - Do not show PayPal Express Button on the product detail page, if the product is in clearance\", \"PT-11292 - Add possibility to enter separate credentials for sandbox mode\"], \"1.3.0\": [\"PT-10448 - Adds onboarding to get API credentials with PayPal login in settings module\", \"PT-11292 - Adds possibility to enter separate credentials for sandbox mode in first run wizard\", \"PT-11498 - Adds PayPal Express Button to QuickView from CMS Extensions plugin\", \"PT-11550 - Fix usage of sandbox credentials after an update\"], \"1.4.0\": [\"PT-11540 - Corrects remaining amount for multiple partial refunds\", \"PT-11541 - Improved behaviour of multiple partial refunds & captures\", \"PT-11606 - Shopware 6.2 compatibility\"], \"1.5.0\": [\"NEXT-8322 - Shopware 6.2 compatibility\", \"PT-10654 - Activate and set PayPal as default for the selected Saleschannel in the settings module\", \"PT-11599 - Fixes a bug where PayPal Plus could not be configured individually per Saleschannel\"], \"1.5.1\": [\"PT-10640 - Fix SalesChannel api routes\", \"PT-10897 - Locale code validation for Smart Payment Buttons and Express Checkout\", \"PT-11294 - Error handling for Smart Payment Buttons\", \"PT-11582 - Fix webhook registration\", \"PT-11637 - Improve capture and refund workflow\"], \"1.5.2\": [\"PT-10502 - Canceling the payment on the PayPal site no longer leads to errors\", \"PT-11710 - Fix installation of plugin in environments where the default language is not de-DE or en-GB\"], \"1.6.0\": [\"PT-11519 - Registers webhooks with HTTPS\", \"PT-11593 - Adds hint for \\\"Payment acquisition\\\" option to clarify usage with PayPal PLUS\", \"PT-11704 - Fix displaying of Express Checkout Button on paginated product listing pages\", \"PT-11706 - Country states are now saved on Express Checkout\", \"PT-11717 - Adds PayPal cookies to the cookie manager\"], \"1.7.0\": [\"PT-11669 - Add compatibility with the after order payment process\", \"PT-11707 - Custom form parameter of the order confirm page are no longer ignored\", \"PT-11748 - Fix redirect URL for PayPal Plus and Express Checkout. Changed webhook URL to be independent of a storefront\", \"PT-11773 - Fix buying of Custom Products with PayPal\", \"PT-11813 - Error handling for Express Checkout button\", \"PT-11858 - Improved handling of multiple transactions per order\", \"PT-11869 - Improved handling of payments which were cancelled by customers\"], \"1.7.1\": [\"PT-11884 - If PayPal is not available, Plus and Smart Payment Buttons are no longer loaded\"], \"1.7.2\": [\"PT-10491 - Removed internally used custom field entity for transaction IDs\", \"PT-11627 - Order transactions now have the state \\\"In Progress\\\" when the payment process has been started\", \"PT-11680 - Removed unknown Sales Channel types from selection in settings\", \"PT-11681 - Fix order details header in Administration, if accessing payment details directly\", \"PT-11860 - Fix order confirmation email language with PayPal Plus\", \"PT-11888 - Minor performance improvement when creating a payment\", \"PT-11903 - Fix failed transaction status for user-canceled PayPal Plus payments